import React from 'react'

const CartItem= (props) => {
    const {id,productName,price,productImage}=props.data;
  return (
    <div className='cartitem'>
      <img src={productImage}/>
      <div className='description'>
        <p><b>{productName}</b></p>
        <p>{price} Rs</p>
      </div>
    </div>
  )
}

export default CartItem;
